import React from 'react';

function Nav() {


    return(
    <header>
        <div>
            <h1> <a href="/"> JCV </a> </h1>
        </div>
        <nav>
            <ul>
                <li> <a href="#what-we-do">asdasd</a> </li>
                <li> <a href="#what-you-do">ddds</a> </li>
                <li> <a href="#your-trainers">Yours</a> </li>
                <li> <a href="#reach-out">Rt</a> </li>
            </ul>
        </nav>
    </header>
    );
}



export default Nav;
